	const [selected, setSelected] = useState(0);

	const Ab = () => {
		return <button>LOL</button> 
	}

	return (
		<>
			<ButtonsSelector buttons={["Section 1", "Section 2"]} selected={selected} setSelected={setSelected} style={{marginBottom: '100px'}} />
			<FadeProps>
				{selected === 0 ? <>lol1</> : selected === 1 ? <>lol2</> : <></>}
			</FadeProps>
		</>
	);
}

export default Home;
